webpackJsonp([0xb0a3d153c518],{593:function(e,a){e.exports={data:{allMarkdownRemark:{totalCount:1,edges:[{node:{fields:{slug:"/introducing-drank"},excerpt:"How much Caffeine did you drink yesterday? How many units of alcohol did you consume last weekend? Did you drink enough water today? The…",timeToRead:1,frontmatter:{title:"Introducing Drank",tags:["app","drank","drink","Glass Umbrella","health"],cover:"/images/get-drank-banner.jpg",date:"2018-07-14T11:03"}}}]},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{tag:"drink",nodes:[{node:{frontmatter:{title:"Introducing Drank",tags:["app","drank","drink","Glass Umbrella","health"],cover:"/images/get-drank-banner.jpg",date:"2018-07-14T11:03",author:"eddie"},fields:{slug:"/introducing-drank"},html:'<p>How much Caffeine did you drink yesterday? How many units of alcohol did you consume last weekend? Did you drink enough water today? The answer to these questions for a lot of people is often too much of the bad stuff, and not enough of the good stuff.</p>\n<p><img src="/images/drank-woman-drink.png" alt="Woman using the Drank app"></p>\n<p>Using <a href="https://itunes.apple.com/gb/app/drank/id1224749685?mt=8&#x26;ct=eddieleeme">the Drank app</a> over the last few months has allowed me to improve the balance of what I drink. I knew I drank a lot of caffeine, but until I saw it charted in Drank I wasn’t aware it was over 80% of my daily water intake, sometimes drinking in excess of 10 cups a day.</p>\n<p>Today we’re proud to release Drank to the world!</p>\n<p>Give Drank a go. Gain insights, and drink better.</p>\n<p>Available now for iOS and coming soon for Android.</p>\n<p><a href="https://itunes.apple.com/gb/app/drank/id1224749685?mt=8&#x26;ct=eddieleeme"><img src="/images/download-app-store.png" alt="Download on the App Store"></a></p>',timeToRead:1}}],page:1,pages:1,total:1,limit:5}}}});
